import React from 'react';

const Team = (props) => {
    const {strAlternate,strCountry,intFormedYear,strTeamBadge}=props.teams;
    const styleTeam={
        border:'2px solid red',
        margin:'10px',
        borderRadius:'20px'

    }
    return (
        
        <div style={styleTeam}>
            <img style={{width:'200px'}} src={strTeamBadge} alt=""/>
            <h1>Name:{strAlternate}</h1>
            <h12>Country:{strCountry}</h12>
            <h3>Year:{intFormedYear}</h3>
        </div>
    );
};

export default Team;
